insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('温州','古称“瓯”，早在4000多年前，这里就有原始瓯人繁衍生息.汉惠帝三年（公元前192年）建东瓯国，封越王勾践第七世孙驺摇为东海王，世称东瓯王，国都在今温州市区.唐高宗上元二年（公元675年）设立温州后，区域范围和名称才开始稳定.南宋时温州在农业、造船、采矿等方面发展很快，并成为对外贸易口岸之一，此后温州一直为历代路、府所处.#x_e_k#古称“瓯”，早在4000多年前，这里就有原始瓯人繁衍生息。汉惠帝三年（公元前192年）建东瓯国，封越王勾践第七世孙驺摇为东海王，世称东瓯王，国都在今温州市区。唐高宗上元二年（公元675年）设立温州后，区域范围和名称才开始稳定。南宋时温州在农业、造船、采矿等方面发展很快，并成为对外贸易口岸之一，此后温州一直为历代路、府所处。','wenzhou');
