insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('惠普','HP 由斯坦福大学学生 Bill Hewlett 和 Dave Packard 于 1939 年创建. 该公司建在硅谷的一间汽车库里，第一个产品是声频振荡器，是音响师使用的电子测试仪器. HP 的第一个客户是 Walt Disney Studios，该公司购买了 8 台音频振荡器为电影《Fantasia》开发和测试具有创新意义的音响系统.#x_e_k#HP 由斯坦福大学学生 Bill Hewlett 和 Dave Packard 于 1939 年创建。 该公司建在硅谷的一间汽车库里，第一个产品是声频振荡器，是音响师使用的电子测试仪器。 HP 的第一个客户是 Walt Disney Studios，该公司购买了 8 台音频振荡器为电影《Fantasia》开发和测试具有创新意义的音响系统。#x_e_k#800-820-2255','huipu');
