insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('北京时间','北京是中华人民共和国的首都，中国中央四个直辖市之一，中国的政治、文化、外交中心，国内国际交往中心之一，全国第二大城市（仅次于上海市），中国北方最大的城市.这个拥有1700多万人口的城市已经成为一个现代化国际大都市.#x_e_k#北京是中华人民共和国的首都，中国中央四个直辖市之一，中国的政治、文化、外交中心，国内国际交往中心之一，全国第二大城市（仅次于上海市），中国北方最大的城市。这个拥有1700多万人口的城市已经成为一个现代化国际大都市。','beijingshijian');
