insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('胡椒','胡椒是一种重要的热带香辛作物.它的种子含有挥发油、胡椒碱、粗脂肪、粗蛋白等，是人们喜爱的调味品.在医学工作上胡椒可用作健胃剂、解热剂、利尿剂及支气管粘膜刺激剂等，可治疗消化不良、寒痰、肠炎、支气管炎、感冒和风湿病等.此外在食品工作上还用作防腐剂.胡椒是多年生作物，一般植后2—3年即可放花结果，经济寿命达20年左右，年产量达1500—2250千克/公顷（白胡椒），管理良好的胡椒园产量可达3750—4500千克/公顷，小#x_e_k#胡椒是一种重要的热带香辛作物。它的种子含有挥发油、胡椒碱、粗脂肪、粗蛋白等，是人们喜爱的调味品。在医学工作上胡椒可用作健胃剂、解热剂、利尿剂及支气管粘膜刺激剂等，可治疗消化不良、寒痰、肠炎、支气管炎、感冒和风湿病等。此外在食品工作上还用作防腐剂。胡椒是多年生作物，一般植后2—3年即可放花结果，经济寿命达20年左右，年产量达1500—2250千克/公顷（白胡椒），管理良好的胡椒园产量可达3750—4500千克/公顷，小','hujiao');
