insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('孤注一掷','解释:把所有的钱一次押上去，决一输赢.比喻在危急时用尽所有力量作最后一次冒险.出处《宋史·寇准传》:“博者输钱欲尽，乃罄所有出之，谓之孤注.”《晋书·何无忌传》:“刘毅家无担石之储，樗蒲一掷百万.”#x_e_k#解释:把所有的钱一次押上去，决一输赢。比喻在危急时用尽所有力量作最后一次冒险。出 处《宋史·寇准传》:“博者输钱欲尽，乃罄所有出之，谓之孤注。”《晋书·何无忌传》:“刘毅家无担石之储，樗蒲一掷百万。”#x_e_k#解释:把所有的钱一次押上去，决一输赢.比喻在危急时用尽所有力量作最后一次冒险.出 处《宋史·寇准传》:“博者输钱欲尽，乃罄所有出之，谓之孤注.”《晋书·何无忌传》:“刘毅家无担石之储，樗蒲一掷百万.”','guzhuyizhi');
