insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('画眉举案','画眉:指汉张敞为妻画眉毛的故事；举案:指汉朝孟光为夫送饭的故事.比喻夫妻互敬互爱.【出处】《汉书·张敞传》:“（敞）又为妇画眉，长安中传张京兆眉怃.有司以奏敞.上问之，对曰:‘臣闻闺房之内，夫妇之私，有过于画眉者.’”东汉孟光为夫送饭时，把端饭的盘子举到和眉毛一样齐，见《后汉书·逸民传·梁鸿》.#x_e_k#画眉:指汉张敞为妻画眉毛的故事；举案:指汉朝孟光为夫送饭的故事。比喻夫妻互敬互爱。【出处】《汉书·张敞传》:“（敞）又为妇画眉，长安中传张京兆眉怃。有司以奏敞。上问之，对曰:‘臣闻闺房之内，夫妇之私，有过于画眉者。’”东汉孟光为夫送饭时，把端饭的盘子举到和眉毛一样齐，见《后汉书·逸民传·梁鸿》。','huameijuan');
