insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('回天乏术','回天:比喻力量大，能移转极难挽回的时势；乏术:缺少方法.比喻局势或病情严重，已无法挽救.〖出处〗清·冯起凤《昔柳摭谈·秋风自悼》:“后探得的耗，万箭攒心，脏腑欲裂.但木已成舟，回天乏术.#x_e_k#回天:比喻力量大，能移转极难挽回的时势；乏术:缺少方法。比喻局势或病情严重，已无法挽救。〖出处〗清·冯起凤《昔柳摭谈·秋风自悼》:“后探得的耗，万箭攒心，脏腑欲裂。但木已成舟，回天乏术。','huitianfashu');
