insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('进退无门','释义前进无路，后退无门.形容处境十分困难，进退两难，无处容身.出处宋,朱熹《答刘季章》:“吾道不幸遽失，此人馀子纷纷，才有毛发利害，便章皇失措，进退无门，亦何足为轩轾耶.”#x_e_k#释义 前进无路，后退无门。形容处境十分困难，进退两难，无处容身。  出处 宋,朱熹《答刘季章》:“吾道不幸遽失，此人馀子纷纷，才有毛发利害，便章皇失措，进退无门，亦何足为轩轾耶。”#x_e_k#释义 前进无路，后退无门.形容处境十分困难，进退两难，无处容身. 出处 宋,朱熹《答刘季章》:“吾道不幸遽失，此人馀子纷纷，才有毛发利害，便章皇失措，进退无门，亦何足为轩轾耶.”','jintuiwumen');
