insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('三徙成都','成都位于中国四川省中部，是四川省省会，中国副省级城市之一，四川省政治、经济、文教中心，国家经济与社会发展计划单列市，也是国家历史文化名城.成都是中国西南部重要的交通枢纽.成都古为蜀国地，秦并巴、蜀为蜀郡并建城，汉因织锦业发达专设锦官管理，故有“锦官城”之称，五代蜀时遍种芙蓉，故别称“芙蓉城”，简称“蓉”，1921年设市.#x_e_k#成都位于中国四川省中部，是四川省省会，中国副省级城市之一，四川省政治、经济、文教中心，国家经济与社会发展计划单列市，也是国家历史文化名城。成都是中国西南部重要的交通枢纽。成都古为蜀国地，秦并巴、蜀为蜀郡并建城，汉因织锦业发达专设锦官管理，故有“锦官城”之称，五代蜀时遍种芙蓉，故别称“芙蓉城”，简称“蓉”，1921年设市。','sanxichengdu');
