insert into `qa_13790091509`(`q`,`a`,`pinyin`) values('理想','他们问我有什么理想 我就说 我想拥有一幢小房子 可能是我的房子 跟别人的不太一样吧 我理想中的房子啊 屋顶是杏仁糖片 烟囱是烤猪肉卷 床是蜜糖红枣糕 枕头全都是水晶虾饺 下雨下的是葡萄干 下雪下的是棒棒糖 屋外随处可见小笼灌汤包 河里流的全是皮蛋瘦肉粥 河里游的天上飞的都是熟的 我哼一声 它们就自动排着队往我嘴里跳 天上的云是棉花糖 地上的石头是红烧肉……','lixiang');
